description:
Over the past few days, you've seen a little drrrrrama unfold amongst the modteam here at Suprbay.

We've done several things - including my banning half the modteam, closing the void, etc, that may seem extreme to you.

Well, I'd like to tell you, that it was not extreme. It was not extreme at all. In fact, it was a regular and natural part of every forum modteams' life. And that is the pursuit of lulz. We take our lulzgetting very seriously here at Suprbay. There's little we will NOT do, in the course of attaining lulz, and we believe that is both right and proper.

With that in mind, please accept this gift we have whipped up a la carte for you, our patient users and continuous lulzcows. We appreciate your patience, and the lulz you have given us.

Everyone except Scotty. He knows what he has done.

I declare the Void reopened whenever I get around to undoing all my handiwork. &lt;a href=&quot;
